import React from 'react';

const Header = () => {
  return (
    <>
      <div className='headerWrapper themeBg light py2'>
        <div className='containerFluid1'>
          <header>
            <div className='headerRow row justifyBetween alignCenter'>
              <div className='brand'>
                <h1 className='fontStyle fsH1'>Theme Switcher</h1>
              </div>
            </div>
          </header>
        </div>
      </div>
    </>
  );
};

export default Header;
